import React from 'react';

import classes from './About.css';
import Gregor from '../../Assets/Images/greg.png';
import Phone from '../../Assets/Images/Icons/phone.svg';
import Email from '../../Assets/Images/Icons/envelope.svg';
import Github from '../../Assets/Images/Icons/github.svg';
// import fds from ''

const about = (props) => {

    return (
        <div className={classes.About}>
            <img src={Gregor} alt='MyPhoto'></img>
            <h1>Grzegorz <br/> Dytrych</h1>
            <div>
                <div>
                    <img src={Phone} alt='phonelogo'></img>
                    <h2>516 096 431</h2>
                </div>
                <div>
                    <img src={Email} alt='emaillogo'></img>
                    <h2><form action='mailto:karczmarz@gmail.com' target='_blank'><button>karczmarz@gmail.com</button></form></h2>
                </div>
                <div>
                    <img src={Github} alt='githublogo'></img>
                    <h2>Sasquatch88</h2>
                </div>
            </div>
        </div>
    );
};

export default about;
